import React, { Component } from 'react';


export default class Fetch extends Component {
  constructor(props){
    super(props);
    this.state ={
      players:{}
    }
  }
  componentDidMount() {
    fetch('/players/1')
      .then(response => response.json())
      .then(parsedJSON =>{this.setState({players :parsedJson[0]})})
      .catch (error => console.log('fetch failed',error))
    }; 
  ;
  // 
  render() {
    return (
      <div>
       bla{this.state.players.id}
      </div>
    )
  }
}
